import NavBar from "./components/navigation-bar";
import ProductCard from "./components/product-card";
import React from 'react';
// import { ReactComponent as ReactLogo } from './animations/logo.svg';

let pointer = document.getElementById("bot");

const cardClicked = ()=>
{
  let element = this.currentStyle || getComputedStyle(this, null);
  //console.log(element.marginLeft)

  pointer.style.top = element.marginTop
  pointer.style.transition = "all 2s"
}

const App = () => {
  return (
    <div className="App">
      <NavBar></NavBar>
      <div className="contentArea row">
        <div className="two col-lg-12">
          <ProductCard cardClicked= {cardClicked}></ProductCard>
          <div id="bot"></div>
          {/* <div className="assistant">
            <ReactLogo></ReactLogo>
          </div> */}
        </div>
      </div>
    </div>
  );
}

export default App;
